Description of 
Holotype

(
CESF
2861
) (

Fig 
4

). A small sized dicroglossid frog (SVL = 
19.3 mm
) with slender body; head length sub equal to head width (HL = 
7.3 mm
; HW = 
7.1 mm
); snout pointed (SL = 
2.9 mm
) and sub equal to eye diameter (EL = 
2.3 mm
); canthus rostralis angled, loreal region concave, inter orbital space flat (IUE = 
1.8 mm
) sub equal to upper lid (UEW = 
1.3 mm
) and internarial distance (IN = 
1.8 mm
); distance between back of eyes 
1.3
times more than front of eyes (IFE = 
3.5 mm
; 
IBE
= 
4.8 mm
); nostrils oval, nearer to tip of snout; symphysial knob moderate; tympanum indistinct barely visible below the supratympanic fold (
TYD
= 
1.1 mm
); vomerine ridges absent; tongue bifid without a papilla.

Fore arm slender and short (FLL = 
3.6 mm
) slightly longer than hand (
HAL
= 
4.6 mm
); finger short and thin without any dermal fringes (TFL = 
3.3 mm
), tips blunt without any enlarged discs, webbing between fingers absent; subarticular tubercles distinct, rounded and pre-pollex tubercle distinct, supernumerary tubercles absent.

Skin on the dorsum, flanks and belly smooth; few faint longitudinal glandular folds on the dorsum; ventrally smooth on throat and belly but granular at the region of thighs. Colour on the dorsum light brown, black streak from tip of snout to groin passing canthus rostralis, supratympanic fold and flanks on either side of the body; lower lip and region of rictal gland yellowish; fore and hind limbs barred; ventrally throat and thighs translucent, belly creamish yellow with fejervaryan lines on either side of the body. Iris copper brown with fine blackish reticulations (
Fig 3
).

Fejervarya gomantaki
sp. nov.
can be distinguished from
Fejervarya sahyadris
in having a relatively larger adult male size of SVL 19.3 mm ± 0.68 , n= 7 (vs relatively smaller adult male size SVL 18.4 mm ± 0.67 , n= 6 in
F. sahyadris
); lower MN/SVL ratio of 0.272 ( 0.222–0.307 , n= 7 ) (vs higher MN/SVL ratio of 0.366 ( 0.331–0.428 , n= 6 ) in
F. sahyadris
); lower MFE/SVL ratio of 0.202 ( 0.173–0.238 , n= 7 ) (vs higher MFE/SVL ratio of 0.298 ( 0.266–0.359 , n= 6 ) in
F. sahyadris
); lower MBE/SVL ratio of 0.116 (0.100– 0.129 , n= 7 ) (vs higher MBE/SVL ratio of 0.172 ( 0.147–0.206 , n= 6 ) in
F. sahyadris
); finger I is shortest (vs finger IV is shortest in
F. sahyadris
); vomerine ridge and palmar tubercle indistinct (vs distinct vomerine ridge and palmar tubercle in
F. sahyadris
); brown dorsum, lateral sides of the body light creamish, black streak from the tip of snout passing through canthus rostralis and tympanic region tapering to the region of groin, hind limbs with dark cross bars (vs dorsum brick red to dark brown, lateral sides dark greyish, dark brown band on the canthus rostralis and at the region of tympanum below the supra tympanic fold, limbs with faint cross bars in
F. sahyadris
); known distribution from Chigule village of Belgaum district in the North (
N 15.74
) to Bondla Wildlife Sanctuary in the South (
N 15.44
) (vs known distribution from Sagara of Shimoga district in the North (
N 13.98
) to Mukkam of Calicut district in the South (
N 11.33
) for
F. sahyadris
).
